      SELECT ALL + - col2 - - 53 AS col0 FROM tab0 (FORMAT parquet) cor0 WHERE NOT - col1 BETWEEN - col2 / - + 33 + col2 - col2 AND NULL AND - ( - col2 ) + 64 IS NULL;
  - name: tab0

outputs:
  - name: q11511.out
    data: |
